import React, {Component } from 'react';
import './App.css';
 import * as _b_ from 'react-Bootstrap';
class Barre extends Component {
   
    render() { 
        return ( <div className="nav-bar">

<_b_.Navbar>
  <_b_.Navbar.Header>
    <_b_.Navbar.Brand>
      <a href="#home">React-Bootstrap</a>
    </_b_.Navbar.Brand>
  </_b_.Navbar.Header>
  <_b_.Nav>
    <_b_.NavItem eventKey={1} href="#">
      Link
    </_b_.NavItem>
    <_b_.NavItem eventKey={2} href="#">
      Link
    </_b_.NavItem>
    <_b_.NavDropdown eventKey={3} title="Dropdown" id="basic-nav-dropdown">
      <_b_.MenuItem eventKey={3.1}>Action</_b_.MenuItem>
      <_b_.MenuItem eventKey={3.2}>Another action</_b_.MenuItem>
      <_b_.MenuItem eventKey={3.3}>Something else here</_b_.MenuItem>
      <_b_.MenuItem divider />
      <_b_.MenuItem eventKey={3.4}>Separated link</_b_.MenuItem>
    </_b_.NavDropdown>
  </_b_.Nav>
</_b_.Navbar>;





        

           
           

      
         
        </div>);
    }
}






 
export default Barre;
